: note 850 for i over / 2 mod 128 * AU ! next drop ;
: rst  850 for 0 AU ! next ;

: C-1 31 note ;
: C$1 29 note ;
: D-1 27 note ;
: D$1 26 note ;
: G$1 19 note ;
: A$1 17 note ;
: B-1 16 note ;

: cs1  D$1 rst G$1 rst D$1 rst G$1 rst
       D-1 rst G$1 rst D-1 rst G$1 rst
       C$1 rst G$1 rst C$1 rst G$1 rst ;
: cs2  C-1 rst G$1 rst C-1 rst C$1 D-1 ;
: cs3  B-1 rst A$1 rst G$1 rst rst rst ;

: main loop cs1 cs2 cs1 cs3 again ;
